function: "Team Engineering Challenge:\r\nConstruct a biological enclosure \r\nin 7 minutes using plastic parts and precut bamboo, \r\n\r\nThis bilogical enclosure can be used to support mosquito netting and may help combat the spread of malaria in countries with restricted economies and open borders.\r\n\r\nPart 1 of 2: Center Piece:\r\nCreates tension from 4 corners with string to help keep base of bamboo enclosure stable and \"squared\".\r\n\r\nPart 2 of 2: Corner Piece:\r\nSecures bamboo pieces in corners to create a base and allows two arching bamboo pieces to form a dome from which to hang mosquito netting"
